    return (
        <div className="home">
            <div>
                <Logo />
            </div>
            <div className="home-container">
                <div>
                <Sides source={homeside} />
                <p className="slogan">
                Your hassle free solution for creating organized schedules.
                </p>
                </div>

            </div>

        </div>

    )


}
export default Home;
